INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (1, N'It', N'In a small town in Maine, seven children known as The Losers Club come face to face with life problems, bullies and a monster that takes the shape of a clown called Pennywise.', CAST(N'2017-09-05' AS Date), 135, 346364, N'tt1396484', N'/9E2y5Q7WlCVNEhP5GiVTjhEhx1o.jpg', N'/tcheoA2nPATCm2vvXw2hVQoaEFD.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (2, N'Thor: Ragnarok', N'Thor is imprisoned on the other side of the universe and finds himself in a race against time to get back to Asgard to stop Ragnarok, the destruction of his homeworld and the end of Asgardian civilization, at the hands of an all-powerful new threat, the ruthless Hela.', CAST(N'2017-10-25' AS Date), 130, 284053, N'tt3501632', N'/oSLd5GYGsiGgzDPKTwQh7wamO8t.jpg', N'/wBzMnQ01R9w58W6ucltdYfOyP4j.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (3, N'Thor: The Dark World', N'Thor fights to restore order across the cosmos… but an ancient race led by the vengeful Malekith returns to plunge the universe back into darkness. Faced with an enemy that even Odin and Asgard cannot withstand, Thor must embark on his most perilous and personal journey yet, one that will reunite him with Jane Foster and force him to sacrifice everything to save us all.', CAST(N'2013-10-29' AS Date), 112, 76338, N'tt1981115', N'/bnX5PqAdQZRXSw3aX3DutDcdso5.jpg', N'/3FweBee0xZoY77uO1bhUOlQorNH.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (4, N'Thor', N'Against his father Odin''s will, The Mighty Thor - a powerful but arrogant warrior god - recklessly reignites an ancient war. Thor is cast down to Earth and forced to live among humans as punishment. Once here, Thor learns what it takes to be a true hero when the most dangerous villain of his world sends the darkest forces of Asgard to invade Earth.', CAST(N'2011-04-21' AS Date), 115, 10195, N'tt0800369', N'/bIuOWTtyFPjsFDevqvF3QrD1aun.jpg', N'/LvmmDZxkTDqp0DX7mUo621ahdX.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (5, N'Minions', N'Minions Stuart, Kevin and Bob are recruited by Scarlet Overkill, a super-villain who, alongside her inventor husband Herb, hatches a plot to take over the world.', CAST(N'2015-06-17' AS Date), 91, 211672, N'tt2293640', N'/q0R4crx2SehcEEQEkYObktdeFy.jpg', N'/uX7LXnsC7bZJZjn048UCOwkPXWJ.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (6, N'Happy Death Day', N'A college student relives the day of her murder over and over again as she tries to discover her killer''s identity.', CAST(N'2017-10-12' AS Date), 96, 440021, N'tt5308322', N'/cTaEIUYTt52ooq9quVbAQ7NpGwo.jpg', N'/eGx5OfOdvM0gkHdmkLe3hcJuEIT.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (7, N'Blade Runner 2049', N'Thirty years after the events of the first film, a new blade runner, LAPD Officer K, unearths a long-buried secret that has the potential to plunge what''s left of society into chaos. K''s discovery leads him on a quest to find Rick Deckard, a former LAPD blade runner who has been missing for 30 years.', CAST(N'2017-10-04' AS Date), 163, 335984, N'tt1856101', N'/aMpyrCizvSdc0UIMblJ1srVgAEF.jpg', N'/mVr0UiqyltcfqxbAUcLl9zWL8ah.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (8, N'Blade Runner', N'In the smog-choked dystopian Los Angeles of 2019, blade runner Rick Deckard is called out of retirement to terminate a quartet of replicants who have escaped to Earth seeking their creator for a way to extend their short life spans.', CAST(N'1982-06-25' AS Date), 117, 78, N'tt0083658', N'/p64TtbZGCElxQHpAMWmDHkWJlH2.jpg', N'/tv8J6uCTKsTlASa8luJqrFiJlBX.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (9, N'Sleight', N'A young street magician is left to take care of his little sister after his mother''s passing and turns to drug dealing in the Los Angeles party scene to keep a roof over their heads. When he gets into trouble with his supplier, his sister is kidnapped and he is forced to rely on both his sleight of hand and brilliant mind to save her.', CAST(N'2017-04-28' AS Date), 89, 347882, N'tt4573516', N'/wridRvGxDqGldhzAIh3IcZhHT5F.jpg', N'/2SEgJ0mHJ7TSdVDbkGU061tR33K.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (10, N'Jigsaw', N'Dead bodies begin to turn up all over the city, each meeting their demise in a variety of grisly ways. All investigations begin to point the finger at deceased killer John Kramer.', CAST(N'2017-10-20' AS Date), 92, 298250, N'tt3348730', N'/zUbUtxiTdEgWnkXY945gtYYqBZ1.jpg', N'/ytKpFaLMpFWnuSXStz1GHrtTt6R.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (11, N'Saw', N'Obsessed with teaching his victims the value of life, a deranged, sadistic serial killer abducts the morally wayward. Once captured, they must face impossible choices in a horrific game of survival. The victims must fight to win their lives back, or die trying...', CAST(N'2004-10-01' AS Date), 103, 176, N'tt0387564', N'/dHYvIgsax8ZFgkz1OslE4V6Pnf5.jpg', N'/wXZB5DV0sgdSlFRUrZdE7fBLGEH.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (12, N'Saw III', N'Jigsaw has disappeared. Along with his new apprentice Amanda, the puppet-master behind the cruel, intricate games that have terrified a community and baffled police has once again eluded capture and vanished. While city detective scramble to locate him, Doctor Lynn Denlon and Jeff Reinhart are unaware that they are about to become the latest pawns on his vicious chessboard.', CAST(N'2006-10-27' AS Date), 114, 214, N'tt0489270', N'/zHMw9xGrNlrDsuK6Lnx5NlL72Eu.jpg', N'/b9liJ8BN35m7DogM2YvnVMRI26Y.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (13, N'Saw II', N'When a new murder victim is discovered with all the signs of Jigsaw''s hand, Detective Eric Matthews begins a full investigation and apprehends Jigsaw with little effort. But for Jigsaw, getting caught is just another part of his plan. Eight more of his victims are already fighting for their lives and now it''s time for Matthews to join the game...', CAST(N'2005-10-28' AS Date), 89, 215, N'tt0432348', N'/vC7ggR8njwtQOZRmrSvMtHqy9hx.jpg', N'/AiVEqxrkov15dfzliosRXcE0w39.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (14, N'Saw IV', N'Jigsaw and his apprentice Amanda are dead. Now, upon the news of Detective Kerry''s murder, two seasoned FBI profilers, Agent Strahm and Agent Perez, arrive in the terrified community to assist the veteran Detective Hoffman in sifting through Jigsaw''s latest grisly remains and piecing together the puzzle. However, when SWAT Commander Rigg is abducted and thrust into a game, the last officer untouched by Jigsaw has but ninety minutes to overcome a series of demented traps and save an old friend...or face the deadly consequences.', CAST(N'2007-10-25' AS Date), 96, 663, N'tt0890870', N'/veApHw5ARGHWf3ptKf30rOGFY9n.jpg', N'/yKATxJtGY67cXdOmlbWwW6EgPqn.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (15, N'Saw V', N'Detective Hoffman is seemingly the last person alive to carry on the Jigsaw legacy. But when his secret is threatened, he must go on the hunt to eliminate all the loose ends.', CAST(N'2008-10-23' AS Date), 95, 11917, N'tt1132626', N'/AkfY99GJjnsuOpIaQlFzCsv5pBl.jpg', N'/riCNFvTbbgjWYIhy6Ow5gBd8ZqW.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (16, N'Saw VI', N'Special Agent Strahm is dead, and Detective Hoffman has emerged as the unchallenged successor to Jigsaw''s legacy. However, when the FBI draws closer to Hoffman, he is forced to set a game into motion, and Jigsaw''s grand scheme is finally understood.', CAST(N'2009-10-22' AS Date), 96, 22804, N'tt1233227', N'/iCVk1uniEoQLXdluUGUXBaAgD1H.jpg', N'/mfL91mRgncWZLGprAW1ZCKAOawG.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (17, N'Saw: The Final Chapter', N'As a deadly battle rages over Jigsaw''s brutal legacy, a group of Jigsaw survivors gathers to seek the support of self-help guru and fellow survivor Bobby Dagen, a man whose own dark secrets unleash a new wave of terror.', CAST(N'2010-10-21' AS Date), 90, 41439, N'tt1477076', N'/mBQX4TCfDEk2a5mvu0Z0PFeFoUp.jpg', N'/hYWa2kS45Ix7K3KrEgY3EAmpM7P.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (18, N'Geostorm', N'Gerard Butler playing a stubborn but charming satellite designer who, when the world’s climate-controlling satellites malfunction, has to work together with his estranged brother to save the world from a man-made storm of epic proportions. A trip into space follows, while on Earth a plot to assassinate the president begins to unfold.', CAST(N'2017-10-13' AS Date), 109, 274855, N'tt1981128', N'/nrsx0jEaBgXq4PWo7SooSnYJTv.jpg', N'/lhTtnsPmEYUJB7nOaTKJzYoxJ7X.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (19, N'Big Hero 6', N'The special bond that develops between plus-sized inflatable robot Baymax, and prodigy Hiro Hamada, who team up with a group of friends to form a band of high-tech heroes.', CAST(N'2014-10-24' AS Date), 102, 177572, N'tt2245084', N'/9gLu47Zw5ertuFTZaxXOvNfy78T.jpg', N'/2BXd0t9JdVqCp9sKf6kzMkr7QjB.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (20, N'Beauty and the Beast', N'A live-action adaptation of Disney''s version of the classic ''Beauty and the Beast'' tale of a cursed prince and a beautiful young woman who helps him break the spell.', CAST(N'2017-03-16' AS Date), 129, 321612, N'tt2771200', N'/tWqifoYuwLETmmasnGHO7xBjEtt.jpg', N'/6aUWe0GSl69wMTSWWexsorMIvwU.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (21, N'Spider-Man: Homecoming', N'Following the events of Captain America: Civil War, Peter Parker, with the help of his mentor Tony Stark, tries to balance his life as an ordinary high school student in Queens, New York City, with fighting crime as his superhero alter ego Spider-Man as a new threat, the Vulture, emerges.', CAST(N'2017-07-05' AS Date), 133, 315635, N'tt2250912', N'/kY2c7wKgOfQjvbqe7yVzLTYkxJO.jpg', N'/vc8bCGjdVp0UbMNLzHnHSLRbBWQ.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (22, N'War for the Planet of the Apes', N'Caesar and his apes are forced into a deadly conflict with an army of humans led by a ruthless Colonel. After the apes suffer unimaginable losses, Caesar wrestles with his darker instincts and begins his own mythic quest to avenge his kind. As the journey finally brings them face to face, Caesar and the Colonel are pitted against each other in an epic battle that will determine the fate of both their species and the future of the planet.', CAST(N'2017-07-11' AS Date), 140, 281338, N'tt3450958', N'/3vYhLLxrTtZLysXtIWktmd57Snv.jpg', N'/ulMscezy9YX0bhknvJbZoUgQxO5.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (23, N'Rise of the Planet of the Apes', N'Scientist Will Rodman is determined to find a cure for Alzheimer''s, the disease which has slowly consumed his father. Will feels certain he is close to a breakthrough and tests his latest serum on apes, noticing dramatic increases in intelligence and brain activity in the primate subjects – especially Caesar, his pet chimpanzee.', CAST(N'2011-08-03' AS Date), 105, 61791, N'tt1318514', N'/esqXMJv6PiK7GJVRwd2FA3SZUoW.jpg', N'/caIpcr9xhvRcWfOMRDq3F5iIcLB.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (24, N'Dawn of the Planet of the Apes', N'A group of scientists in San Francisco struggle to stay alive in the aftermath of a plague that is wiping out humanity, while Caesar tries to maintain dominance over his community of intelligent apes.', CAST(N'2014-06-26' AS Date), 130, 119450, N'tt2103281', N'/2EUAUIu5lHFlkj5FRryohlH6CRO.jpg', N'/rjUl3pd1LHVOVfG4IGcyA1cId5l.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (25, N'American Made', N'The true story of pilot Barry Seal, who transported contraband for the CIA and the Medellin cartel in the 1980s.', CAST(N'2017-08-17' AS Date), 115, 337170, N'tt3532216', N'/8dTWj3c74RDhXfSUZpuyVNJrgS.jpg', N'/jcKzxRGYiXuS7ctTHLdw9wH8d7V.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (26, N'Jungle', N'A mysterious guide escorts an enthusiastic adventurer and his friend into the Amazon jungle, but their journey turns into a terrifying ordeal as the darkest elements of human nature and the deadliest threats of the wild force them to fight for survival.', CAST(N'2017-10-20' AS Date), 113, 390062, N'tt3758172', N'/tDgxknTVwrScxpCYyGUjXSn5NRk.jpg', N'/go1a6YwrVTMrNNIfaRpBRp5pIzV.jpg')
