INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (30, N'John Wick: Chapter 2', N'John Wick is forced out of retirement by a former associate looking to seize control of a shadowy international assassins’ guild. Bound by a blood oath to aid him, Wick travels to Rome and does battle against some of the world’s most dangerous killers.', CAST(N'2017-02-08' AS Date), 122, 324552, N'tt4425200', N'/zkXnKIwX5pYorKJp2fjFSfNyKT0.jpg', N'/dQ6s3Ud2KoOs3LKw6xgZr1cw7Yq.jpg')
