INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (38, N'The Hunger Games: Mockingjay - Part 1', N'Katniss Everdeen reluctantly becomes the symbol of a mass rebellion against the autocratic Capitol.', CAST(N'2014-11-18' AS Date), 123, 131631, N'tt1951265', N'/gj282Pniaa78ZJfbaixyLXnXEDI.jpg', N'/4PwyB0ErucIANzW24Kori71J6gU.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (39, N'The Hunger Games: Mockingjay - Part 2', N'With the nation of Panem in a full scale war, Katniss confronts President Snow in the final showdown. Teamed with a group of her closest friends – including Gale, Finnick, and Peeta – Katniss goes off on a mission with the unit from District 13 as they risk their lives to stage an assassination attempt on President Snow who has become increasingly obsessed with destroying her. The mortal traps, enemies, and moral choices that await Katniss will challenge her more than any arena she faced in The Hunger Games.', CAST(N'2015-11-18' AS Date), 137, 131634, N'tt1951266', N'/w93GAiq860UjmgR6tU9h2T24vaV.jpg', N'/qjn3fzCAHGfl0CzeUlFbjrsmu4c.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (40, N'The Hunger Games', N'Every year in the ruins of what was once North America, the nation of Panem forces each of its twelve districts to send a teenage boy and girl to compete in the Hunger Games.  Part twisted entertainment, part government intimidation tactic, the Hunger Games are a nationally televised event in which “Tributes” must fight with one another until one survivor remains.  Pitted against highly-trained Tributes who have prepared for these Games their entire lives, Katniss is forced to rely upon her sharp instincts as well as the mentorship of drunken former victor Haymitch Abernathy.  If she’s ever to return home to District 12, Katniss must make impossible choices in the arena that weigh survival against humanity and life against love. The world will be watching.', CAST(N'2012-03-12' AS Date), 142, 70160, N'tt1392170', N'/iLJdwmzrHFjFwI5lvYAT1gcpRuA.jpg', N'/1LTLrl06uII4w2BTpnQnmWwrKi.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (41, N'The Hunger Games: Catching Fire', N'Katniss Everdeen has returned home safe after winning the 74th Annual Hunger Games along with fellow tribute Peeta Mellark. Winning means that they must turn around and leave their family and close friends, embarking on a "Victor''s Tour" of the districts. Along the way Katniss senses that a rebellion is simmering, but the Capitol is still very much in control as President Snow prepares the 75th Annual Hunger Games (The Quarter Quell) - a competition that could change Panem forever.', CAST(N'2013-11-15' AS Date), 146, 101299, N'tt1951264', N'/Hn0KgefVEp0GkdTexS6gfKTMfi.jpg', N'/wRCPG1lsgfTFkWJ7G3eWgxCgv0C.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (42, N'Pulp Fiction', N'A burger-loving hit man, his philosophical partner, a drug-addled gangster''s moll and a washed-up boxer converge in this sprawling, comedic crime caper. Their adventures unfurl in three stories that ingeniously trip back and forth in time.', CAST(N'1994-09-10' AS Date), 154, 680, N'tt0110912', N'/dM2w364MScsjFf8pfMbaWUcWrR.jpg', N'/9rZg1J6vMQoDVSgRyWcpJa8IAGy.jpg')
