INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (46, N'Suburbicon', N'A crime mystery set in the quiet family town of Suburbicon during the 1950s, where the best and worst of humanity is hilariously reflected through the deeds of seemingly ordinary people. When a home invasion turns deadly, a picture-perfect family turns to blackmail, revenge, and murder.', CAST(N'2017-10-27' AS Date), 104, 395458, N'tt0491175', N'/a3IHgSwO5jWPLcGjKqbQ7pxVGkq.jpg', N'/zA5zlFVa76LdHmlFQrXaBW4XSvG.jpg')
