INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (49, N'Tragedy Girls', N'Following two death-obsessed teenage girls who use their online show about real-life tragedies to send their small Midwestern town into a frenzy and cement their legacy as modern horror legends.', CAST(N'2017-10-20' AS Date), 96, 413857, N'tt3859272', N'/qMwuplUU4dg9JBBhgML42T6x0yJ.jpg', N'/t8mrHYeVzu4kTmgVArqL09hi5f6.jpg')
