INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (58, N'Chiara e Francesco', N'Italy, XIII century. The story of friendship between two young people who dedicated their lives to God and others: St. Francis and St. Clare of Assisi. Children of the bourgeoisie and the nobility, respectively, gave up their lives accommodated by a life of sacrifice, humility and proselytizing ...', CAST(N'2007-01-01' AS Date), 200, 138129, N'tt0990362', N'/jjRsfwMb1cojHjaY3vZsdMy9fIa.jpg', N'/n6tHeze754dRHelAF1Vvibjk9t1.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (59, N'The Carmilla Movie', N'It has been five years since Laura and Carmilla vanquished the apocalypse and Carmilla became a bonafide mortal human. They have settled in to a cozy apartment in downtown Toronto, Laura continues to hone her journalism skills while Carmilla adjusts to a non-vampire lifestyle. Their domestic bliss is suddenly ruptured when Carmilla begins to show signs of "re-vamping" – from a fondness for bloody treats to accidental biting – while Laura has started having bizarre, ghostly dreams. The couple must now enlist their old friends from Silas University to uncover the unknown supernatural threat and save humanity – including Carmilla''s.', CAST(N'2017-10-26' AS Date), 94, 421131, N'tt7427856', N'/sSQlCNbF43nkOnuFsXhDq08Tw0c.jpg', N'/AjWSgCRy7FQeViVHiN0jPZWU9Ur.jpg')
