INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (61, N'Deadpool', N'Deadpool tells the origin story of former Special Forces operative turned mercenary Wade Wilson, who after being subjected to a rogue experiment that leaves him with accelerated healing powers, adopts the alter ego Deadpool. Armed with his new abilities and a dark, twisted sense of humor, Deadpool hunts down the man who nearly destroyed his life.', CAST(N'2016-02-09' AS Date), 108, 293660, N'tt1431045', N'/inVq3FRqcYIRl2la8iZikYYxFNR.jpg', N'/n1y094tVDFATSzkTnFxoGZ1qNsG.jpg')
