INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (65, N'Justice League', N'Fueled by his restored faith in humanity and inspired by Superman''s selfless act, Bruce Wayne and Diana Prince assemble a team of metahumans consisting of Barry Allen, Arthur Curry, and Victor Stone to face the catastrophic threat of Steppenwolf and the Parademons who are on the hunt for three Mother Boxes on Earth.', CAST(N'2017-11-15' AS Date), 0, 141052, N'tt0974015', N'/9rtrRGeRnL0JKtu9IMBWsmlmmZz.jpg', N'/o5T8rZxoWSBMYwjsUFUqTt6uMQB.jpg')
