INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (67, N'Murder on the Orient Express', N'Genius Belgian detective Hercule Poirot investigates the murder of an American tycoon aboard the Orient Express train.', CAST(N'2017-11-03' AS Date), 114, 392044, N'tt3402236', N'/iBlfxlw8qwtUS0R8YjIU7JtM6LM.jpg', N'/tvKcA4OFUiZkNeTJmmTkNqKHMMg.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (68, N'The Dark Knight', N'Batman raises the stakes in his war on crime. With the help of Lt. Jim Gordon and District Attorney Harvey Dent, Batman sets out to dismantle the remaining criminal organizations that plague the streets. The partnership proves to be effective, but they soon find themselves prey to a reign of chaos unleashed by a rising criminal mastermind known to the terrified citizens of Gotham as the Joker.', CAST(N'2008-07-16' AS Date), 152, 155, N'tt0468569', N'/1hRoyzDtpgMU7Dz4JF22RANzQO7.jpg', N'/hqkIcbrOHL86UncnHIsHVcVmzue.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (69, N'The Dark Knight Rises', N'Following the death of District Attorney Harvey Dent, Batman assumes responsibility for Dent''s crimes to protect the late attorney''s reputation and is subsequently hunted by the Gotham City Police Department. Eight years later, Batman encounters the mysterious Selina Kyle and the villainous Bane, a new terrorist leader who overwhelms Gotham''s finest. The Dark Knight resurfaces to protect a city that has branded him an enemy.', CAST(N'2012-07-16' AS Date), 165, 49026, N'tt1345836', N'/dEYnvnUfXrqvqeRSqvIEtmzhoA8.jpg', N'/3bgtUfKQKNi3nJsAB5URpP2wdRt.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (70, N'Batman Begins', N'Driven by tragedy, billionaire Bruce Wayne dedicates his life to uncovering and defeating the corruption that plagues his home, Gotham City.  Unable to work within the system, he instead creates a new identity, a symbol of fear for the criminal underworld - The Batman.', CAST(N'2005-06-10' AS Date), 140, 272, N'tt0372784', N'/dr6x4GyyegBWtinPBzipY02J2lV.jpg', N'/65JWXDCAfwHhJKnDwRnEgVB411X.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (71, N'The Shawshank Redemption', N'Framed in the 1940s for the double murder of his wife and her lover, upstanding banker Andy Dufresne begins a new life at the Shawshank prison, where he puts his accounting skills to work for an amoral warden. During his long stretch in prison, Dufresne comes to be admired by the other inmates -- including an older prisoner named Red -- for his integrity and unquenchable sense of hope.', CAST(N'1994-09-23' AS Date), 142, 278, N'tt0111161', N'/9O7gLzmreU0nGkIB6K3BsJbzvNv.jpg', N'/xBKGJQsAIeweesB79KC89FpBrVr.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (72, N'Fight Club', N'A ticking-time-bomb insomniac and a slippery soap salesman channel primal male aggression into a shocking new form of therapy. Their concept catches on, with underground "fight clubs" forming in every town, until an eccentric gets in the way and ignites an out-of-control spiral toward oblivion.', CAST(N'1999-10-15' AS Date), 139, 550, N'tt0137523', N'/adw6Lq9FiC9zjYEpOqfq03ituwp.jpg', N'/8uO0gUM8aNqYLs1OsTBQiXu0fEv.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (73, N'A Bad Moms Christmas', N'In this comedy a few  titular under-appreciated and over-burdened friends cope with the stresses of the most wonderful time of year as their own mothers visit for the holidays.', CAST(N'2017-11-03' AS Date), 104, 431530, N'tt6359956', N'/gPNHolu7AGnrB7r5kvJRRTfwMFR.jpg', N'/oR4u6ZlLx0nVUuq1OfYKuwVhtkg.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (74, N'Transformers: The Last Knight', N'Autobots and Decepticons are at war, with humans on the sidelines. Optimus Prime is gone. The key to saving our future lies buried in the secrets of the past, in the hidden history of Transformers on Earth.', CAST(N'2017-06-16' AS Date), 149, 335988, N'tt3371366', N'/s5HQf2Gb3lIO2cRcFwNL9sn1o1o.jpg', N'/Ytv7P13rbwQ3mLpCAY8lBTqI5s.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (75, N'Transformers', N'Young teenager, Sam Witwicky becomes involved in the ancient struggle between two extraterrestrial factions of transforming robots – the heroic Autobots and the evil Decepticons. Sam holds the clue to unimaginable power and the Decepticons will stop at nothing to retrieve it.', CAST(N'2007-06-27' AS Date), 144, 1858, N'tt0418279', N'/bgSHbGEA1OM6qDs3Qba4VlSZsNG.jpg', N'/p4OHBbXfxToWF4e36uEhQMSidWu.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (76, N'Transformers: Revenge of the Fallen', N'Sam Witwicky leaves the Autobots behind for a normal life. But when his mind is filled with cryptic symbols, the Decepticons target him and he is dragged back into the Transformers'' war.', CAST(N'2009-06-19' AS Date), 150, 8373, N'tt1055369', N'/kVISXAXDYhjQCfu50QZeCCzzbPv.jpg', N'/tg7UGXaUROpzY5ppPh7dnvy4l7P.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (77, N'Transformers: Dark of the Moon', N'Sam Witwicky takes his first tenuous steps into adulthood while remaining a reluctant human ally of Autobot-leader Optimus Prime. The film centers around the space race between the USSR and the USA, suggesting there was a hidden Transformers role in it all that remains one of the planet''s most dangerous secrets.', CAST(N'2011-06-28' AS Date), 154, 38356, N'tt1399103', N'/sZY3ls18QTY0pFBJn2vl2MmauTQ.jpg', N'/76ZUJdlSUISSapiKXK3uG3Y8cuO.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (78, N'Transformers: Age of Extinction', N'As humanity picks up the pieces, following the conclusion of "Transformers: Dark of the Moon," Autobots and Decepticons have all but vanished from the face of the planet. However, a group of powerful, ingenious businessman and scientists attempt to learn from past Transformer incursions and push the boundaries of technology beyond what they can control - all while an ancient, powerful Transformer menace sets Earth in his cross-hairs.', CAST(N'2014-06-25' AS Date), 165, 91314, N'tt2109248', N'/ykIZB9dYBIKV13k5igGFncT5th6.jpg', N'/cHy7nSitAVgvZ7qfCK4JO47t3oZ.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (79, N'Transformers 7', N'Plot unknown.', CAST(N'2019-06-26' AS Date), 0, 424785, N'tt5090564', N'/432BowXw7a4fWXSONxBaFKqvW4f.jpg', N'')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (80, N'Bumblebee', N'On the run in the year 1987, Bumblebee finds refuge in a junkyard in a small Californian beach town. Charlie, on the cusp of turning 18 and trying to find her place in the world, discovers Bumblebee, battle-scarred and broken.  When Charlie revives him, she quickly learns this is no ordinary yellow VW bug.', CAST(N'2018-12-20' AS Date), 0, 424783, N'tt4701182', N'/btEpckwEpEvfxrZLqAuFxD1E3NT.jpg', N'/6eFzlVwb9FeS1XddzwMLO8nC7UF.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (81, N'Cars 3', N'Blindsided by a new generation of blazing-fast racers, the legendary Lightning McQueen is suddenly pushed out of the sport he loves. To get back in the game, he will need the help of an eager young race technician with her own plan to win, inspiration from the late Fabulous Hudson Hornet, and a few unexpected turns. Proving that #95 isn''t through yet will test the heart of a champion on Piston Cup Racing’s biggest stage!', CAST(N'2017-06-15' AS Date), 109, 260514, N'tt3606752', N'/fyy1nDC8wm553FCiBDojkJmKLCs.jpg', N'/rND0GSv8X2Zzs7VhyFAs9BCEmYE.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (82, N'Cars', N'Lightning McQueen, a hotshot rookie race car driven to succeed, discovers that life is about the journey, not the finish line, when he finds himself unexpectedly detoured in the sleepy Route 66 town of Radiator Springs. On route across the country to the big Piston Cup Championship in California to compete against two seasoned pros, McQueen gets to know the town''s offbeat characters.', CAST(N'2006-06-08' AS Date), 117, 920, N'tt0317219', N'/5damnMcRFKSjhCirgX3CMa88MBj.jpg', N'/a1MlbLBk5Sy6YvMbSuKfwGlDVlb.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (83, N'Cars 2', N'Star race car Lightning McQueen and his pal Mater head overseas to compete in the World Grand Prix race. But the road to the championship becomes rocky as Mater gets caught up in an intriguing adventure of his own: international espionage.', CAST(N'2011-06-11' AS Date), 106, 49013, N'tt1216475', N'/AblhtULOVtrkSnFxRPQ8gBemxw9.jpg', N'/jEcmZhtJkZQc6ta2vzBd9CU7GIx.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (84, N'The Dark Tower', N'The last Gunslinger, Roland Deschain, has been locked in an eternal battle with Walter O’Dim, also known as the Man in Black, determined to prevent him from toppling the Dark Tower, which holds the universe together. With the fate of the worlds at stake, good and evil will collide in the ultimate battle as only Roland can defend the Tower from the Man in Black.', CAST(N'2017-08-03' AS Date), 95, 353491, N'tt1648190', N'/i9GUSgddIqrroubiLsvvMRYyRy0.jpg', N'/pVVobDO8cezhVPvwD6EBUN0g3mt.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (85, N'Your Name.', N'High schoolers Mitsuha and Taki are complete strangers living separate lives. But one night, they suddenly switch places. Mitsuha wakes up in Taki’s body, and he in hers. This bizarre occurrence continues to happen randomly, and the two must adjust their lives around each other.', CAST(N'2016-08-26' AS Date), 106, 372058, N'tt5311514', N'/xq1Ugd62d23K2knRUx6xxuALTZB.jpg', N'/7OMAfDJikBxItZBIug0NJig5DHD.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (86, N'The Godfather', N'Spanning the years 1945 to 1955, a chronicle of the fictional Italian-American Corleone crime family. When organized crime family patriarch, Vito Corleone barely survives an attempt on his life, his youngest son, Michael steps in to take care of the would-be killers, launching a campaign of bloody revenge.', CAST(N'1972-03-14' AS Date), 175, 238, N'tt0068646', N'/rPdtLWNsZmAtoZl9PK7S2wE3qiS.jpg', N'/6xKCYgH16UuwEGAyroLU6p8HLIn.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (87, N'The Godfather: Part II', N'In the continuing saga of the Corleone crime family, a young Vito Corleone grows up in Sicily and in 1910s New York. In the 1950s, Michael Corleone attempts to expand the family business into Las Vegas, Hollywood and Cuba.', CAST(N'1974-12-20' AS Date), 200, 240, N'tt0071562', N'/bVq65huQ8vHDd1a4Z37QtuyEvpA.jpg', N'/gLbBRyS7MBrmVUNce91Hmx9vzqI.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (88, N'The Godfather: Part III', N'In the midst of trying to legitimize his business dealings in 1979 New York and Italy, aging mafia don, Michael Corleone seeks forgiveness for his sins while taking a young protege under his wing.', CAST(N'1990-12-24' AS Date), 162, 242, N'tt0099674', N'/1hdm3Axw9LjITbApvAXBbqO58zE.jpg', N'/mhdJ2rOK3JGnceqxNK9WufYmFr7.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (89, N'Guardians of the Galaxy Vol. 2', N'The Guardians must fight to keep their newfound family together as they unravel the mysteries of Peter Quill''s true parentage.', CAST(N'2017-04-19' AS Date), 137, 283995, N'tt3896198', N'/y4MBh0EjBlMuOzv9axM4qJlmhzz.jpg', N'/aJn9XeesqsrSLKcHfHP4u5985hn.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (90, N'Guardians of the Galaxy', N'Light years from Earth, 26 years after being abducted, Peter Quill finds himself the prime target of a manhunt after discovering an orb wanted by Ronan the Accuser.', CAST(N'2014-07-30' AS Date), 121, 118340, N'tt2015381', N'/y31QB9kn3XSudA15tV7UWQ9XLuW.jpg', N'/bHarw8xrmQeqf3t8HpuMY7zoK4x.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (91, N'Guardians of the Galaxy Vol. 3', N'', CAST(N'2020-05-01' AS Date), 0, 447365, N'tt6791350', N'/ldoY4fTZkGISMidNw60GHoNdgP8.jpg', N'/jRSAkKG9QSu6Nc1zvI3ejmgLshe.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (92, N'Pirates of the Caribbean: Dead Men Tell No Tales', N'Thrust into an all-new adventure, a down-on-his-luck Capt. Jack Sparrow feels the winds of ill-fortune blowing even more strongly when deadly ghost sailors led by his old nemesis, the evil Capt. Salazar, escape from the Devil''s Triangle. Jack''s only hope of survival lies in seeking out the legendary Trident of Poseidon, but to find it, he must forge an uneasy alliance with a brilliant and beautiful astronomer and a headstrong young man in the British navy.', CAST(N'2017-05-23' AS Date), 129, 166426, N'tt1790809', N'/xbpSDU3p7YUGlu9Mr6Egg2Vweto.jpg', N'/2Qwb7EayKsD2cuB3I2u2k2VU3Lb.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (93, N'Pirates of the Caribbean: The Curse of the Black Pearl', N'Jack Sparrow, a freewheeling 17th-century pirate who roams the Caribbean Sea, butts heads with a rival pirate bent on pillaging the village of Port Royal. When the governor''s daughter is kidnapped, Sparrow decides to help the girl''s love save her. But their seafaring mission is hardly simple.', CAST(N'2003-07-09' AS Date), 143, 22, N'tt0325980', N'/tkt9xR1kNX5R9rCebASKck44si2.jpg', N'/8AUQ7YlJJA9C8kWk8P4YNHIcFDE.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (94, N'Pirates of the Caribbean: Dead Man''s Chest', N'Captain Jack Sparrow works his way out of a blood debt with the ghostly Davey Jones, he also attempts to avoid eternal damnation.', CAST(N'2006-06-20' AS Date), 151, 58, N'tt0383574', N'/waFr5RVKaQ9dzOt3nQuIVB1FiPu.jpg', N'/hdHgIcljPHli4xaJGt0INz8Gn3J.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (95, N'Pirates of the Caribbean: At World''s End', N'Captain Barbossa, long believed to be dead, has come back to life and is headed to the edge of the Earth with Will Turner and Elizabeth Swann. But nothing is quite as it seems.', CAST(N'2007-05-19' AS Date), 169, 285, N'tt0449088', N'/bXb00CkHqx7TPchTGG131sWV59y.jpg', N'/8ZgpAftUiYTU76IhUADITa3Ur9n.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (96, N'Pirates of the Caribbean: On Stranger Tides', N'Captain Jack Sparrow crosses paths with a woman from his past, and he''s not sure if it''s love -- or if she''s a ruthless con artist who''s using him to find the fabled Fountain of Youth. When she forces him aboard the Queen Anne''s Revenge, the ship of the formidable pirate Blackbeard, Jack finds himself on an unexpected adventure in which he doesn''t know who to fear more: Blackbeard or the woman from his past.', CAST(N'2011-05-14' AS Date), 136, 1865, N'tt1298650', N'/wNUDAq5OUMOtxMlz64YaCp7gZma.jpg', N'/l7zANdjgTvYqwZUx76Vk0EKpCH5.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (97, N'The Beguiled', N'During the Civil War, at a Southern girls’ boarding school, young women take in an injured enemy soldier. As they provide refuge and tend to his wounds, the house is taken over with sexual tension and dangerous rivalries, and taboos are broken in an unexpected turn of events.', CAST(N'2017-06-23' AS Date), 93, 399019, N'tt5592248', N'/uQxfqFAqAvNK5b1wD11b2ycDAVg.jpg', N'/qU6b4cZK4V1Ih8FgdvOgoGDtncf.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (98, N'Valerian and the City of a Thousand Planets', N'In the 28th century, Valerian and Laureline are special operatives charged with keeping order throughout the human territories. On assignment from the Minister of Defense, the two undertake a mission to Alpha, an ever-expanding metropolis where species from across the universe have converged over centuries to share knowledge, intelligence, and cultures. At the center of Alpha is a mysterious dark force which threatens the peaceful existence of the City of a Thousand Planets, and Valerian and Laureline must race to identify the menace and safeguard not just Alpha, but the future of the universe.', CAST(N'2017-07-20' AS Date), 137, 339964, N'tt2239822', N'/8L7FE3bXjN98BcmKANzrL9WwKsK.jpg', N'/pyNIx3gOnQGMsKPlu0mzsdr6Owo.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (99, N'Kingsman: The Golden Circle', N'When an attack on the Kingsman headquarters takes place and a new villain rises, Eggsy and Merlin are forced to work together with the American agency known as the Statesman to save the world.', CAST(N'2017-09-20' AS Date), 141, 343668, N'tt4649466', N'/pKESfn2Pdy0b7drvZHQb7UzgqoY.jpg', N'/uExPmkOHJySrbJyJDJylHDqaT58.jpg')
GO
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (100, N'Kingsman: The Secret Service', N'The story of a super-secret spy organization that recruits an unrefined but promising street kid into the agency''s ultra-competitive training program just as a global threat emerges from a twisted tech genius.', CAST(N'2015-01-29' AS Date), 130, 207703, N'tt2802144', N'/8x7ej0LnHdKUqilNNJXYOeyB6L9.jpg', N'/7McaexSsSTLD8V17UgaZAfI0Cu9.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (101, N'Kingsman 3', N'Plot unknown. Third installment of the ''Kingsman'' franchise', NULL, 0, 476669, N'tt6856242', N'', N'')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (102, N'Leatherface', N'A young nurse is kidnapped by a group of violent teens who escape from a mental hospital and take her on the road trip from hell. Pursued by an equally deranged lawman out for revenge, one of the teens is destined for tragedy and horrors that will destroy his mind, moulding him into a monster named ''Leatherface''.', CAST(N'2017-09-14' AS Date), 88, 300665, N'tt2620590', N'/qdRq1EygZK2LIYM6v29ai9uBOhE.jpg', N'/oE91eSoOlzfKpXPfzRwr9cMwEON.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (103, N'The Texas Chain Saw Massacre', N'Five friends visiting their grandfather''s house in the country are hunted and terrorized by a chain-saw wielding killer and his family of grave-robbing cannibals.', CAST(N'1974-10-01' AS Date), 83, 30497, N'tt0072271', N'/hXF5nuEvUIlMXv4fOCIhA8KWaN2.jpg', N'/bAtnyMa4jXc1bVUco6wCZBFh0f2.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (104, N'Leatherface: Texas Chainsaw Massacre III', N'A couple encounters a perverted gas station attendant who threatens them with a shotgun. They take a deserted path in Texas to seek help, but only meet up with a cannibalistic clan interested in helping themselves to fresh meat.', CAST(N'1990-01-12' AS Date), 81, 25018, N'tt0099994', N'/6NmMY1e7P9bkb0I1srDuV6fjIzt.jpg', N'/atO6sOpvD68ooQHKWtMyaXKHYxb.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (105, N'Texas Chainsaw Massacre: The Next Generation', N'Everyone''s favorite chainsaw-wielding psychopath, Leatherface, is back for more prom-night gore, and this time he''s joined by his bloodthirsty family. Four stranded yet carefree teens are taken in by a backwoods family, clueless of their host family''s grisly habits. The terrified youths, including sweet Jenny, try to escape from Leatherface and his crazed clan, including the bionic Vilmer.', CAST(N'1994-01-01' AS Date), 95, 16780, N'tt0110978', N'/eSg1yVW3R2iIj5WqMvua5MQeJsF.jpg', N'/1Unx2N8AhIBinp2QaLe2t27Nnix.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (106, N'The Texas Chainsaw Massacre 2', N'A radio host is victimized by the cannibal family as a former Texas Marshall hunts them.', CAST(N'1986-08-22' AS Date), 101, 16337, N'tt0092076', N'/1EI0Qs6AhtxdamRBsFC4zm2I6sj.jpg', N'/ajdhwlImMWSWTu1sEMv72yu7IqK.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (107, N'Texas Chainsaw 3D', N'A young woman learns that she has inherited a Texas estate from her deceased grandmother. After embarking on a road trip with friends to uncover her roots, she finds she is the sole owner of a lavish, isolated Victorian mansion. But her newfound wealth comes at a price as she stumbles upon a horror that awaits her in the mansion’s dank cellars.', CAST(N'2013-01-03' AS Date), 92, 76617, N'tt1572315', N'/p0kJOoNvwnWgmvKvL4GqlV3OPUV.jpg', N'/l7hHzXb5cly5dlo6smdpUkOMaoI.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (108, N'Coco', N'The discovery of a generations-old mystery leads to a most extraordinary and surprising family reunion.', CAST(N'2017-10-27' AS Date), 109, 354912, N'tt2380307', N'/eKi8dIrr8voobbaGzDpe8w0PVbC.jpg', N'/gqk6fLXiJnuHRF3IC2sNAfnRJo6.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (109, N'Revolt', N'The story of humankind''s last stand against a cataclysmic alien invasion. Set in the war-ravaged African countryside, a U.S. soldier and a French foreign aid worker team up to survive the alien onslaught. Their bond will be tested as they search for refuge across a crumbling world.', CAST(N'2017-07-01' AS Date), 87, 313943, N'tt3722614', N'/eM2zipCkAXhp0BZF2noDp7bRFgV.jpg', N'/pJc4tR2aXYBBZDtpowamW0RL1KI.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (110, N'Schindler''s List', N'The true story of how businessman Oskar Schindler saved over a thousand Jewish lives from the Nazis while they worked as slaves in his factory during World War II.', CAST(N'1993-11-29' AS Date), 195, 424, N'tt0108052', N'/yPisjyLweCl1tbgwgtzBCNCBle.jpg', N'/rIpSszng8P0DL0TimSzZbpfnvh1.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (111, N'Logan', N'In the near future, a weary Logan cares for an ailing Professor X in a hideout on the Mexican border. But Logan''s attempts to hide from the world and his legacy are upended when a young mutant arrives, pursued by dark forces.', CAST(N'2017-02-28' AS Date), 137, 263115, N'tt3315342', N'/gGBu0hKw9BGddG8RkRAMX7B6NDB.jpg', N'/5pAGnkFYSsFJ99ZxDIYnhQbQFXs.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (112, N'X-Men Origins: Wolverine', N'After seeking to live a normal life, Logan sets out to avenge the death of his girlfriend by undergoing the mutant Weapon X program and becoming Wolverine.', CAST(N'2009-04-28' AS Date), 107, 2080, N'tt0458525', N'/kqO36IYvWbRKMPiUeiVZUFH06Rc.jpg', N'/mEuDxpLNBCarVgXRqDznHT7bdS8.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (113, N'The Wolverine', N'Wolverine faces his ultimate nemesis - and tests of his physical, emotional, and mortal limits - in a life-changing voyage to modern-day Japan.', CAST(N'2013-07-23' AS Date), 126, 76170, N'tt1430132', N'/iTST6DcLhfufWYUKCOskkusaYUq.jpg', N'/oFyaTmJ5ZPPl16uB4Ry9pWKvtDc.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (114, N'Spirited Away', N'A young girl, Chihiro, becomes trapped in a strange new world of spirits. When her parents undergo a mysterious transformation, she must call upon the courage she never knew she had to free her family.', CAST(N'2001-07-20' AS Date), 125, 129, N'tt0245429', N'/dL11DBPcRhWWnJcFXl9A07MrqTI.jpg', N'/mnpRKVSXBX6jb56nabvmGKA0Wig.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (115, N'Despicable Me 3', N'Gru and his wife Lucy must stop former ''80s child star Balthazar Bratt from achieving world domination.', CAST(N'2017-06-15' AS Date), 96, 324852, N'tt3469046', N'/5qcUGqWoWhEsoQwNUrtf3y3fcWn.jpg', N'/ftRkFtAGuHngHnLiOxktq0aCVMF.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (116, N'Despicable Me', N'Villainous Gru lives up to his reputation as a despicable, deplorable and downright unlikable guy when he hatches a plan to steal the moon from the sky. But he has a tough time staying on task after three orphans land in his care.', CAST(N'2010-07-08' AS Date), 95, 20352, N'tt1323594', N'/4zHJhBSY4kNZXfhTlmy2TzXD51M.jpg', N'/yo1ef57MEPkEE4BDZKTZGH9uDcX.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (117, N'Despicable Me 2', N'Gru is recruited by the Anti-Villain League to help deal with a powerful new super criminal.', CAST(N'2013-06-25' AS Date), 98, 93456, N'tt1690953', N'/kQrYyZQHkwkUg2KlUDyvymj9FAp.jpg', N'/rmgxcw8tGTmdhsWqdjGBS9uI1tO.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (118, N'Daddy''s Home 2', N'Brad and Dusty must deal with their intrusive fathers during the holidays.', CAST(N'2017-11-09' AS Date), 0, 419680, N'tt5657846', N'/rF2IoKL0IFmumEXQFUuB8LajTYP.jpg', N'/lMDyuHzBhx3zNAv48vYzmgcJCCD.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (119, N'Daddy''s Home', N'The story of a mild-mannered radio executive (Ferrell) who strives to become the best stepdad ever to his wife''s two children, but complications ensue when their freewheeling, freeloading real father arrives, forcing stepdad to compete for the affection of the kids.', CAST(N'2015-12-25' AS Date), 96, 274167, N'tt1528854', N'/diEAZtU6KJzo6VStL5US8arkdIQ.jpg', N'/7j8vfzwVuOLyKYGbzr3NvJtbcSj.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (120, N'Life Is Beautiful', N'A touching story of an Italian book seller of Jewish ancestry who lives in his own little fairy tale. His creative and happy life would come to an abrupt halt when his entire family is deported to a concentration camp during World War II. While locked up he tries to convince his son that the whole thing is just a game.', CAST(N'1997-12-20' AS Date), 116, 637, N'tt0118799', N'/f7DImXDebOs148U4uPjI61iDvaK.jpg', N'/bORe0eI72D874TMawOOFvqWS6Xe.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (121, N'Three Billboards Outside Ebbing, Missouri', N'After seven months have passed without a culprit in her daughter''s murder case, Mildred Hayes makes a bold move, painting three signs leading into her town with a controversial message directed at Bill Willoughby, the town''s revered chief of police. When his second-in-command Officer Jason Dixon, an immature mother''s boy with a penchant for violence, gets involved, the battle between Mildred and Ebbing''s law enforcement is only exacerbated.', CAST(N'2017-11-10' AS Date), 115, 359940, N'tt5027774', N'/vgvw6w1CtcFkuXXn004S5wQsHRl.jpg', N'/m4iybrDnApbzx6AJQPSsCRl7jDF.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (122, N'The Foreigner', N'Quan is a humble London businessman whose long-buried past erupts in a revenge-fueled vendetta when the only person left for him to love -- his teenage daughter -- dies in a senseless act of politically motivated terrorism. His relentless search to find the terrorists leads to a cat-and-mouse conflict with a British government official whose own past may hold the clues to the identities of the elusive killers.', CAST(N'2017-09-24' AS Date), 114, 379149, N'tt1615160', N'/rwM4hzrmc5HiWfQD9ls9DL4QgGl.jpg', N'/p6anj7RQe03Gq2hSIxkkoozPMSH.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (123, N'A Silent Voice', N'Shouya Ishida starts bullying the new girl in class, Shouko Nishimiya, because she is deaf. But as the teasing continues, the rest of the class starts to turn on Shouya for his lack of compassion. When they leave elementary school, Shouko and Shouya do not speak to each other again... until an older, wiser Shouya, tormented by his past behaviour, decides he must see Shouko once more. He wants to atone for his sins, but is it already too late...?', CAST(N'2016-09-17' AS Date), 130, 378064, N'tt5323662', N'/drlyoSKDOPnxzJFrRWGqzDsyJvR.jpg', N'/geINneHhMbGDeDCGun0elRjVQ1Z.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (124, N'Bad Grandmas', N'Four grandmothers accidentally kill a conman and, to cover it up, they get rid of the body. When the conman''s partner shows up, things go south.', CAST(N'2017-11-03' AS Date), 92, 455847, N'tt4792524', N'/ldYHMM1yuNIOpCOiW9m6fiz3Zmm.jpg', N'')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (125, N'One Flew Over the Cuckoo''s Nest', N'While serving time for insanity at a state mental hospital, implacable rabble-rouser, Randle Patrick McMurphy inspires his fellow patients to rebel against the authoritarian rule of head nurse, Mildred Ratched.', CAST(N'1975-11-18' AS Date), 133, 510, N'tt0073486', N'/2Sns5oMb356JNdBHgBETjIpRYy9.jpg', N'/4E7YQcwui0PfNXguf4V2X8YocPC.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (126, N'Dilwale Dulhania Le Jayenge', N'Raj is a rich, carefree, happy-go-lucky second generation NRI. Simran is the daughter of Chaudhary Baldev Singh, who in spite of being an NRI is very strict about adherence to Indian values. Simran has left for India to be married to her childhood fiancé. Raj leaves for India with a mission at his hands, to claim his lady love under the noses of her whole family. Thus begins a saga.', CAST(N'1995-10-20' AS Date), 190, 19404, N'tt0112870', N'/2gvbZMtV1Zsl7FedJa5ysbpBx2G.jpg', N'/nl79FQ8xWZkhL3rDr1v2RFFR6J0.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (127, N'Psycho', N'When larcenous real estate clerk Marion Crane goes on the lam with a wad of cash and hopes of starting a new life, she ends up at the notorious Bates Motel, where manager Norman Bates cares for his housebound mother. The place seems quirky, but fine… until Marion decides to take a shower.', CAST(N'1960-06-16' AS Date), 109, 539, N'tt0054215', N'/81d8oyEFgj7FlxJqSDXWr8JH8kV.jpg', N'/3md49VBCeqY6MSNyAVY6d5eC6bA.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (128, N'Psycho II', N'Years of treatment at a mental institution for the criminally insane, Norman Bates still can''t quite elude the demands of "Mother." Vera Miles also returns as the inquisitive woman who is haunted by her sister''s brutal murder and the ominous motel where it all occurred.', CAST(N'1983-06-03' AS Date), 113, 10576, N'tt0086154', N'/tYNx7yIU9Q3O2xxjy3ie5YCkIak.jpg', N'/nagC0a0F9TsosA6wRjtV2NNNHD1.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (129, N'Psycho III', N'Norman Bates is still running his little motel, and he has kept the dressed skeleton he calls mother. One of his guests is a young girl who has left the convent where she lived. To get some help he employs a young man. One day a nosey journalist comes to see him to ask questions about his past.', CAST(N'1986-04-02' AS Date), 93, 12662, N'tt0091799', N'/gLmUIPVQtEsxtIrvaj5WRKkbvX9.jpg', N'/z3s3TdRvEWC1TFrwtk0qhB7OdHh.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (130, N'Psycho IV: The Beginning', N'Norman Bates is again released from the mental hospital he was placed in at the end of Psycho III after serving another few years and is apparently rehabiliated for the second time. Norman is now married to a young nurse named Connie and is expecting a child. However, Norman fears that the child will inherit his mental illness. Meanwhile, Fran Ambrose is a radio talk show host who is discussing the topic of matricide with guest Dr. Richmond, Norman''s former psychologist. The radio station receives a call from Norman, who uses the alias "Ed" to tell his story.', CAST(N'1990-11-10' AS Date), 96, 40377, N'tt0102724', N'/qE0Ah7xVvJeehVQUrL9WGFb6Pm1.jpg', N'/wLshdSSgdAt3GYz5dDZsJl0bcw6.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (131, N'Flatliners', N'Five medical students, hoping to gain insight into the mystery of what lies beyond the confines of life, embark on a daring and dangerous experiment. By stopping their hearts for short periods of time, each triggers a near-death experience. As the investigation becomes more and more perilous, they are forced to confront the sins of their pasts, as well as contend with the paranormal consequences of trespassing to the other side.', CAST(N'2017-09-28' AS Date), 110, 400710, N'tt2039338', N'/e9NHATN0TJW6ZZPLLWFsKdilVl1.jpg', N'/A9L23hwp8yLUbMci2jIkX4RV6kg.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (132, N'Get My Gun', N'After an innocent prank leaves Amanda pregnant and out of a job, she finds herself on the verge of motherhood and the target of a psychotic stalker who will stop at nothing to get her hands on the unborn child.', CAST(N'2017-11-03' AS Date), 90, 479709, N'tt5833412', N'/nZepGNJAw9JQOCSJSZTxnPmvpa.jpg', N'')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (133, N'Roman J. Israel, Esq.', N'Hard-nosed liberal lawyer Roman J. Israel has been fighting the good fight forever while others take the credit. When his partner, the firm’s frontman, has a heart attack, Israel suddenly takes on that role. He soon discovers some unsettling truths about the firm--truths that conflict with his values of helping the poor and dispossessed--and finds himself in an existential crisis that leads to extreme actions.', CAST(N'2017-11-10' AS Date), 129, 413362, N'tt6000478', N'/8e5IGlLrVjwrlDcRtzSQkXhJFWl.jpg', N'/zms098KnZ30YfV9K0FaeiCUGuQ6.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (134, N'The Void', N'A man is alone in his apartment as an ominous hourglass runs out, and strange things start to happen.', CAST(N'2017-11-01' AS Date), 0, 442076, N'tt6053996', N'/4FnOnf14qlWpQiFWdryk6UtjENU.jpg', N'')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (135, N'The Star', N'A small but brave donkey and his animal friends become the unsung heroes of the greatest story ever told, the first Christmas.', CAST(N'2017-11-15' AS Date), 0, 355547, N'tt4587656', N'/tEbDvivUfsCupngKIfMJJ725eAD.jpg', N'/iJ5dkwIHQnq8dfmwSLh7dpETNhi.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (136, N'My Little Pony: The Movie', N'A new dark force threatens Ponyville, and the Mane 6 – Twilight Sparkle, Applejack, Rainbow Dash, Pinkie Pie, Fluttershy and Rarity – embark on an unforgettable journey beyond Equestria where they meet new friends and exciting challenges on a quest to use the magic of friendship and save their home.', CAST(N'2017-10-05' AS Date), 99, 335360, N'tt4131800', N'/15WbvKx7B7FiLZheK49Xc05oRIX.jpg', N'/t9QTd0V3rbv6W25QbHJuC6zbIo1.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (137, N'Battle of the Sexes', N'The true story of the 1973 tennis match between World number one Billie Jean King and ex-champ and serial hustler Bobby Riggs.', CAST(N'2017-09-22' AS Date), 121, 369192, N'tt4622512', N'/v3y96NrwyBxqNhVpHIBZix0uPKP.jpg', N'/3G5QZHCJyAtGkJhttbxUfWDdh3v.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (138, N'The Man Who Invented Christmas', N'After a series his books have been flops, Charles Dickens decides to write and self-publish A Christmas Carol.', CAST(N'2017-11-22' AS Date), 0, 450322, N'tt6225520', N'/qRkzRue5rTzB6PESXBJCKqROOXC.jpg', N'/2lpHdk1ccelg5odsCmk77WqmIvT.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (139, N'Annabelle: Creation', N'Several years after the tragic death of their little girl, a dollmaker and his wife welcome a nun and several girls from a shuttered orphanage into their home, soon becoming the target of the dollmaker''s possessed creation, Annabelle.', CAST(N'2017-08-03' AS Date), 109, 396422, N'tt5140878', N'/tb86j8jVCVsdZnzf8I6cIi65IeM.jpg', N'/o8u0NyEigCEaZHBdCYTRfXR8U4i.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (140, N'Annabelle', N'John Form has found the perfect gift for his expectant wife, Mia - a beautiful, rare vintage doll in a pure white wedding dress. But Mia''s delight with Annabelle doesn''t last long. On one horrific night, their home is invaded by members of a satanic cult, who violently attack the couple. Spilled blood and terror are not all they leave behind. The cultists have conjured an entity so malevolent that nothing they did will compare to the sinister conduit to the damned that is now... Annabelle.', CAST(N'2014-10-02' AS Date), 99, 250546, N'tt3322940', N'/yAgxM61Sn0dYML4C9v3MJFp5zPI.jpg', N'/8pCFurneAWouGbBMEoBHqU1ejbb.jpg')
