INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (142, N'In a Heartbeat', N'A closeted boy runs the risk of being outed by his own heart after it pops out of his chest to chase down the boy of his dreams.', CAST(N'2017-06-01' AS Date), 4, 455661, N'tt6969946', N'/wJUJROdLOtOzMixkjkx1aaZGSLl.jpg', N'/4datX8btikWEikf7esqEe6fhw.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (143, N'Baywatch', N'Devoted lifeguard Mitch Buchannon butts heads with a brash new recruit. Together, they uncover a local criminal plot that threatens the future of the Bay.', CAST(N'2017-05-12' AS Date), 116, 339846, N'tt1469304', N'/6HE4xd8zloDqmjMZuhUCCw2UcY1.jpg', N'/t6TL7V9IsT4Ktx6YO8b1UYj3agd.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (144, N'The Avengers', N'When an unexpected enemy emerges and threatens global safety and security, Nick Fury, director of the international peacekeeping agency known as S.H.I.E.L.D., finds himself in need of a team to pull the world back from the brink of disaster. Spanning the globe, a daring recruitment effort begins!', CAST(N'2012-04-25' AS Date), 143, 24428, N'tt0848228', N'/cezWGskPY5x7GaglTTRN4Fugfb8.jpg', N'/hbn46fQaRmlpBuUrEiFqv0GDL6Y.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (145, N'Avengers: Age of Ultron', N'When Tony Stark tries to jumpstart a dormant peacekeeping program, things go awry and Earth’s Mightiest Heroes are put to the ultimate test as the fate of the planet hangs in the balance. As the villainous Ultron emerges, it is up to The Avengers to stop him from enacting his terrible plans, and soon uneasy alliances and unexpected action pave the way for an epic and unique global adventure.', CAST(N'2015-04-22' AS Date), 141, 99861, N'tt2395427', N'/t90Y3G8UGQp0f0DrP60wRu9gfrH.jpg', N'/rFtsE7Lhlc2jRWF7SRAU0fvrveQ.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (146, N'Avengers: Infinity War', N'As the Avengers and their allies have continued to protect the world from threats too large for any one hero to handle, a new danger has emerged from the cosmic shadows: Thanos. A despot of intergalactic infamy, his goal is to collect all six Infinity Stones, artifacts of unimaginable power, and use them to inflict his twisted will on all of reality. Everything the Avengers have fought for has led up to this moment - the fate of Earth and existence itself has never been more uncertain.', CAST(N'2018-04-25' AS Date), 0, 299536, N'tt4154756', N'/eTbcifqMr1KwYJuOQwxNDSbzJ1P.jpg', N'/ncEmkHADNggjR0dlerOIHqmiY0O.jpg')
