INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (149, N'Interstellar', N'Interstellar chronicles the adventures of a group of explorers who make use of a newly discovered wormhole to surpass the limitations on human space travel and conquer the vast distances involved in an interstellar voyage.', CAST(N'2014-11-05' AS Date), 169, 157336, N'tt0816692', N'/nBNZadXqJSdt05SHLqgT0HuC5Gm.jpg', N'/xu9zaAevzQ5nnrsXN6JcahLnG4i.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (150, N'Lady Bird', N'Christine "Lady Bird" McPherson, a fiercely independent teenager, tries to make her own way in the world while wanting to get out of her hometown of Sacramento, California & to get away from her complicated mother & recently-unemployed father.', CAST(N'2017-09-08' AS Date), 93, 391713, N'tt4925292', N'/pVtoXPA2zqNTeaR8MOsrD1XvUXK.jpg', N'/kQ3OXX5SgDPBi1wt83HX7VShQG8.jpg')
