INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (152, N'Kidnap', N'Single mother Karla McCoy lives a perfect life with her young son Frankie. One day, upon entering a local park, Karla sees her son suddenly being abducted out of the blue by a kidnapper. To save Frankie from being taken, Karla goes out on a mission to demand people in the city to help rescue her son.', CAST(N'2017-08-04' AS Date), 95, 293768, N'tt1458169', N'/2m3BdGReBe18kLZI119wEpSWQRL.jpg', N'/siRoJI12l4SbWye3wpIotM8OslV.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (153, N'Boundaries', N'Single mom Laura, along with her awkward 14 year-old son Henry is forced to drive Jack, her estranged, care-free pot dealing father across country after he''s kicked out of yet another nursing home.', CAST(N'2017-11-01' AS Date), 110, 447682, N'tt5686062', N'', N'')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (154, N'Batman v Superman: Dawn of Justice', N'Fearing the actions of a god-like Super Hero left unchecked, Gotham City’s own formidable, forceful vigilante takes on Metropolis’s most revered, modern-day savior, while the world wrestles with what sort of hero it really needs. And with Batman and Superman at war with one another, a new threat quickly arises, putting mankind in greater danger than it’s ever known before.', CAST(N'2016-03-23' AS Date), 151, 209112, N'tt2975590', N'/cGOPbv9wA5gEejkUN892JrveARt.jpg', N'/vsjBeMPZtyB7yNsYY56XYxifaQZ.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (155, N'Man of Steel', N'A young boy learns that he has extraordinary powers and is not of this earth. As a young man, he journeys to discover where he came from and what he was sent here to do. But the hero in him must emerge if he is to save the world from annihilation and become the symbol of hope for all mankind.', CAST(N'2013-06-12' AS Date), 143, 49521, N'tt0770828', N'/xWlaTLnD8NJMTT9PGOD9z5re1SL.jpg', N'/jYLh4mdOqkt30i7LTFs3o02UcGF.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (10002, N'Wind River', N'An FBI agent teams with the town''s veteran game tracker to investigate a murder that occurred on a Native American reservation.', CAST(N'2017-08-03' AS Date), 111, 395834, N'tt5362988', N'/fzsaNUcRH0cV2gg5rjQH83ZEI8M.jpg', N'/iF9d73lbtDYeCsPhQmjtkEmlrYG.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (10003, N'1922', N'A simple yet proud rancher in the year 1922 conspires to murder his wife for financial gain, convincing his teenage son to participate.', CAST(N'2017-10-20' AS Date), 101, 452507, N'tt6214928', N'/q4FQOiSRhTLWulHl5Vpg37FMArH.jpg', N'/718iCD1UQ36GSG5fGqzfQ71MEFf.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (10004, N'Wheelman', N'A getaway driver for a bank robbery realizes he has been double crossed and races to find out who betrayed him.', CAST(N'2017-10-20' AS Date), 82, 471014, N'tt5723286', N'/dsgHZDOfHwk1PCnF7Gki8uzOymf.jpg', N'/zABLkisR5i0HQgpBcyWwQGVk89c.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (10005, N'Terminator Genisys', N'The year is 2029. John Connor, leader of the resistance continues the war against the machines. At the Los Angeles offensive, John''s fears of the unknown future begin to emerge when TECOM spies reveal a new plot by SkyNet that will attack him from both fronts; past and future, and will ultimately change warfare forever.', CAST(N'2015-06-23' AS Date), 126, 87101, N'tt1340138', N'/5JU9ytZJyR3zmClGmVm9q4Geqbd.jpg', N'/bIlYH4l2AyYvEysmS2AOfjO7Dn8.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (10006, N'The Terminator', N'In the post-apocalyptic future, reigning tyrannical supercomputers teleport a cyborg assassin known as the "Terminator" back to 1984 to kill Sarah Connor, whose unborn son is destined to lead insurgents against 21st century mechanical hegemony. Meanwhile, the human-resistance movement dispatches a lone warrior to safeguard Sarah. Can he stop the virtually indestructible killing machine?', CAST(N'1984-10-26' AS Date), 108, 218, N'tt0088247', N'/q8ffBuxQlYOHrvPniLgCbmKK4Lv.jpg', N'/6yFoLNQgFdVbA8TZMdfgVpszOla.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (10007, N'Terminator 2: Judgment Day', N'Nearly 10 years have passed since Sarah Connor was targeted for termination by a cyborg from the future. Now her son, John, the future leader of the resistance, is the target for a newer, more deadly terminator. Once again, the resistance has managed to send a protector back to attempt to save John and his mother Sarah.', CAST(N'1991-07-01' AS Date), 137, 280, N'tt0103064', N'/2y4dmgWYRMYXdD1UyJVcn2HSd1D.jpg', N'/d9AqtruwS8nljKjL5aYzM42hQJr.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (10008, N'Terminator 3: Rise of the Machines', N'It''s been 10 years since John Connor saved Earth from Judgment Day, and he''s now living under the radar, steering clear of using anything Skynet can trace. That is, until he encounters T-X, a robotic assassin ordered to finish what T-1000 started. Good thing Connor''s former nemesis, the Terminator, is back to aid the now-adult Connor … just like he promised.', CAST(N'2003-07-02' AS Date), 109, 296, N'tt0181852', N'/lz4xYdF1n09lyiCfZWtWT44SZiG.jpg', N'/tMhvihszpLbOjj7mJSTW7bgQbIc.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (10009, N'Terminator Salvation', N'All grown up in post-apocalyptic 2018, John Connor must lead the resistance of humans against the increasingly dominating militaristic robots. But when Marcus Wright appears, his existence confuses the mission as Connor tries to determine whether Wright has come from the future or the past -- and whether he''s friend or foe.', CAST(N'2009-05-20' AS Date), 115, 534, N'tt0438488', N'/gw6JhlekZgtKUFlDTezq3j5JEPK.jpg', N'/u1B48m74vm4UR4iLOI1Hz4NK8Im.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (10010, N'Untitled Terminator Reboot', N'Plot unknown.', CAST(N'2019-07-26' AS Date), 0, 290859, N'tt6450804', N'', N'')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (10011, N'Captain America: Civil War', N'Following the events of Age of Ultron, the collective governments of the world pass an act designed to regulate all superhuman activity. This polarizes opinion amongst the Avengers, causing two factions to side with Iron Man or Captain America, which causes an epic battle between former allies.', CAST(N'2016-04-27' AS Date), 147, 271110, N'tt3498820', N'/kSBXou5Ac7vEqKd97wotJumyJvU.jpg', N'/m5O3SZvQ6EgD5XXXLPIP1wLppeW.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (10012, N'Captain America: The Winter Soldier', N'After the cataclysmic events in New York with The Avengers, Steve Rogers, aka Captain America is living quietly in Washington, D.C. and trying to adjust to the modern world. But when a S.H.I.E.L.D. colleague comes under attack, Steve becomes embroiled in a web of intrigue that threatens to put the world at risk. Joining forces with the Black Widow, Captain America struggles to expose the ever-widening conspiracy while fighting off professional assassins sent to silence him at every turn. When the full scope of the villainous plot is revealed, Captain America and the Black Widow enlist the help of a new ally, the Falcon. However, they soon find themselves up against an unexpected and formidable enemy—the Winter Soldier.', CAST(N'2014-03-20' AS Date), 136, 100402, N'tt1843866', N'/5TQ6YDmymBpnF005OyoB7ohZps9.jpg', N'/4qfXT9BtxeFuamR4F49m2mpKQI1.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (10013, N'Captain America: The First Avenger', N'Predominantly set during World War II, Steve Rogers is a sickly man from Brooklyn who''s transformed into super-soldier Captain America to aid in the war effort. Rogers must stop the Red Skull – Adolf Hitler''s ruthless head of weaponry, and the leader of an organization that intends to use a mysterious device of untold powers for world domination.', CAST(N'2011-07-22' AS Date), 124, 1771, N'tt0458339', N'/vSNxAJTlD0r02V9sPYpOjqDZXUK.jpg', N'/pmZtj1FKvQqISS6iQbkiLg5TAsr.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (10014, N'Doctor Strange', N'After his career is destroyed, a brilliant but arrogant surgeon gets a new lease on life when a sorcerer takes him under his wing and trains him to defend the world against evil.', CAST(N'2016-10-25' AS Date), 115, 284052, N'tt1211837', N'/4PiiNGXj1KENTmCBHeN6Mskj2Fq.jpg', N'/tFI8VLMgSTTU38i8TIsklfqS9Nl.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (10015, N'Alien: Covenant', N'Bound for a remote planet on the far side of the galaxy, the crew of the colony ship ''Covenant'' discovers what is thought to be an uncharted paradise, but is actually a dark, dangerous world – which has its sole inhabitant the ''synthetic'', David, survivor of the doomed Prometheus expedition.', CAST(N'2017-05-09' AS Date), 122, 126889, N'tt2316204', N'/zecMELPbU5YMQpC81Z8ImaaXuf9.jpg', N'/kMU8trT43p5LFoJ4plIySMOsZ1T.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (10016, N'Prometheus', N'A team of explorers discover a clue to the origins of mankind on Earth, leading them on a journey to the darkest corners of the universe. There, they must fight a terrifying battle to save the future of the human race.', CAST(N'2012-05-30' AS Date), 124, 70981, N'tt1446714', N'/ng8ALjSDhUmwLl7vtjUWIZNQSlt.jpg', N'/rRhoMIqgdX9wEtRUOLsqXKkH9I0.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (10017, N'San Andreas', N'In the aftermath of a massive earthquake in California, a rescue-chopper pilot makes a dangerous journey across the state in order to rescue his estranged daughter.', CAST(N'2015-05-27' AS Date), 114, 254128, N'tt2126355', N'/qey0tdcOp9kCDdEZuJ87yE3crSe.jpg', N'/cUfGqafAVQkatQ7N4y08RNV3bgu.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (10018, N'Black Mirror: White Christmas', N'This feature-length special consists of three interwoven stories. In a mysterious and remote snowy outpost, Matt and Potter share a Christmas meal, swapping creepy tales of their earlier lives in the outside world. Matt is a charismatic American trying to bring the reserved, secretive Potter out of his shell. But are both men who they appear to be? A woman gets thrust into a nightmarish world of ''smart'' gadgetry. Plus a look at what would happen if you could ''block'' people in real life.', CAST(N'2014-12-16' AS Date), 74, 374430, N'tt3973198', N'/he609rnU3tiwBjRklKNa4n2jQSd.jpg', N'/rMCew7St2vy9iV3QOPzx15sAkFJ.jpg')
INSERT [dbo].[tblMovie] ([ID], [Name], [Overview], [Release_Date], [Run_Time], [TMDB_ID], [IMDB_ID], [TMDB_Poster_Path], [TMDB_Backdrop_Path]) VALUES (10019, N'Last Flag Flying', N'Thirty years after serving together in the Vietnam War, Larry "Doc" Shepherd, Sal Nealon and the Rev. Richard Mueller reunite for a different type of mission: to bury Doc''s son, a young Marine killed in Iraq. Forgoing burial at Arlington National Cemetery, Doc and his old buddies take the casket on a bittersweet trip up the coast to New Hampshire. Along the way, the three men find themselves reminiscing and coming to terms with the shared memories of a war that continues to shape their lives.', CAST(N'2017-11-17' AS Date), 124, 419709, N'tt6018306', N'/pizynKUzJ9YucGff1O1MYisY1WM.jpg', N'/xHPH0QvysNtrJA3HkFI0rtOKYm1.jpg')
